css:
@-moz-document domain("deathsnacks.com") {
body{
	background-color: #333333;
	color: #999999;
}

.container{
	background-color: #222222;
    border-radius: 7px;
}

table{
    background-color: #333333;
    color: #999999;
}

.invasion-container{
	background-color: #333333;
}

h2{
	color: white;
}

hr{
	border: none;
}

.list-group-item{
	background-color: #333333;
    color: #999999;
	border: none;
}

.void-trader a{
	color: #999999;
}

.void-trader a:hover{
	background-color: #999999;
	color: #333333;
}

.well{
	background-color: #333333;
	border: none;
}

.table-bordered>tbody>tr>td, .table-bordered>tbody>tr>th, .table-bordered>tfoot>tr>td, .table-bordered>tfoot>tr>th, .table-bordered>thead>tr>td, .table-bordered>thead>tr>th{
	border: none;
	background-color: #333333;
}

.table-bordered{
	border: 1px solid #999999;
}

.armistice_node a{
	color: #999999;
}

.armistice_node a:hover{
	background-color: #999999;
	color: #333333;
}
}
